import React, { useState } from "react";
import {View, StyleSheet, Text} from 'react-native'
import NameTag from "./NameTag";
import Bubble from "./DialogBubble";
import Cat from "./Cat";
import CatFood from "./CatFood";

const ScreenTemplate = () => {
    const [empty, setEmpty] = useState(false);
  return (
    <View style={styles.maincontainor} >
        <View style={styles.header}>
            <Text>Happy Monday :)</Text>
        </View>
        <View style={styles.nameTage}>
            <NameTag name='James' days={233} />
        </View>
        <View style={styles.containor}>
            <View style={styles.catDialog}>
                <Bubble text='hi' />
            </View>
            <View style={styles.cat}>
                <Cat />
            </View>
        </View>
        <View style={styles.catfood}>
            <CatFood empty={empty} num={10}/>
        </View>
        <View style={styles.footer}></View>
    </View>
  )
}

const styles = StyleSheet.create({
    maincontainor: {
        flex: 1,
        flexDirection: 'column',
    },
    header: {
        flex: 3,
        alignItems: 'center',
        justifyContent: 'center',
    },
    containor: {
        flex: 1,
        flexDirection: 'row',
    },
    nameTage: {
        flex: 1,
    },
    containor: {
        flex: 9,
        flexDirection: 'column',
    },
    catDialog: {
        flex: 1,
        justifyContent: 'flex-end',
        alignSelf: 'center',
        marginLeft: 30,
    },
    cat: {
        flex: 3,
        alignSelf: 'center',
    },
    catfood: {
        flex: 2,
    },
    footer: {
        flex: 2,
        backgroundColor: 'grey'
    },
})


export default ScreenTemplate
